INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1001, 'Bacon', 5.99,'United Kingdom','Often eaten with ketchup or brown sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1002, 'Bacon, egg and cheese', 8.99,'United States','A breakfast sandwich, usually with fried or scrambled egg');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1003, 'Baked bean', 9.99,'United States','Canned baked beans on white or brown bread, sometimes with butter.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1004, 'Bánh mì', 4.99,'Vietnam','Filling is typically meat, but can contain a wide range of foods, including sardines, tofu, pâté, or eggs. Served on an airy baguette with pickled carrots, cilantro and peppers.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1005, 'Barbecue', 4.99,'United States','Served on a bun, with chopped, sliced, or shredded meat (pulled pork, beef, or chicken typically), and sometimes topped with coleslaw');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1006, 'Barros Jarpa', 6.99,'Chile','Ham and cheese, usually mantecoso, which is similar to farmer cheese');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1007, 'Barros Luco', 5.99,'Chile','Beef (usually thin-cut steak) and cheese');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1008, 'Bauru', 6.99,'Brazil','Melted cheese, roast beef, tomato, and pickled cucumber in a hollowed-out French roll');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1009, 'Beef on weck', 9.99,'United States','Roast beef on a Kummelweck roll');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1010, 'BLT', 9.99,'United States','Named for its ingredients: bacon, lettuce, and tomato. Often served on toasted sliced bread spread with mayonnaise.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1011, 'Bologna sandwich', 9.99,'United States','Pre-sliced and sometimes fried bologna sausage between slices of white bread, with various condiments such as ketchup, mustard, and mayonnaise.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1012, 'Bosna', 5.99,'Austria','Usually grilled on white bread, containing a bratwurst sausage, onions, and a blend of tomato ketchup, mustard, and curry powder');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1013, 'Breakfast roll', 8.99,'United Kingdom and Ireland','A convenience dish on a variety of bread rolls, containing such breakfast items as sausages, bacon, white or black pudding, mushrooms, tomatoes, hash browns, and fried eggs, often eaten with ketchup or brown sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1014, 'Breakfast', 9.99,'United States','Typically a scrambled or fried egg, cheese, and a sausage patty or other breakfast meat, served on a biscuit or English muffin');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1015, 'British Rail', 6.99,'United Kingdom','A dated reference to the poor quality of catering on the now-defunct British Rail, this refers to any poor-quality sandwich, often stale.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1016, 'Broodje kroket', 5.99,'The Netherlands','A soft bread roll containing a ragout-based croquette, often eaten with mustard.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1017, 'Bun kebab', 8.99,'Pakistan','Consists of a shallow-fried, spicy patty, onions, and chutney or raita in a hamburger or hot dog bun.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1018, 'Butterbrot', 8.99,'Germany','Single, open-faced, containing butter as the common ingredient, with sweet or savory toppings depending on the meal');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1019, 'Cemita', 4.99,'Mexico','Sliced avocado, meat, white cheese, onions, and red sauce (salsa roja), on a fluffy sesame-seeded egg roll, originally from the city of Puebla.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1020, 'Chacarero', 6.99,'Chile','Thinly sliced churrasco-style steak, or lomito-style pork, with tomatoes, green beans, and green chiles, served on a round roll');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1021, 'Cheese', 7.99,'','Made with one or more varieties of cheese. When toasted (pictured), it is commonly referred to as a "grilled cheese sandwich."');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1022, 'Cheese and pickle', 8.99,'United Kingdom','Slices of cheese (typically Cheddar) and pickle (a sweet, vinegary chutney with the most popular brand being Branston), sandwiched between two slices of bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1023, 'Cheesesteak', 8.99,'United States (Philadelphia, Pennsylvania)','Thinly sliced steak and melted cheese in a long roll, also known as a Philadelphia or Philly cheesesteak.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1024, 'Chicken', 5.99,'','A chicken sandwich can contain chicken cooked in a variety of ways. In the United States, common forms of chicken sandwiches include the grilled chicken breast sandwich, the fried chicken breast sandwich, the chicken salad sandwich, and the shredded (or barbeque) chicken sandwich.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1025, 'Chicken salad', 4.99,'','A sandwich prepared with chicken salad as a filling.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1026, 'Chicken schnitzel', 8.99,'Australia','A sandwich of crumbed, pan-fried chicken fillet, on buttered bread, with shredded iceberg lettuce and mayonnaise.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1027, 'Chickpea salad', 8.99,'United States','Chickpea salad is a vegan sandwich filling with a texture similar to tuna salad. Chickpea salad consists of mashed up chickpeas, vegenaise, onions, and other seasonings. Some versions also include tuna.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1028, 'Chili burger', 8.99,'United States','A hamburger, with the patty topped with chili con carne');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1029, 'Chip butty', 4.99,'United Kingdom','Sliced white bread (or a large, flat bread roll) filled with chips, usually sprinkled with salt and vinegar or tomato ketchup.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1030, 'Chipped beef', 4.99,'U.S. military cuisine','A sandwich prepared with thinly sliced or pressed salted and dried beef. Some chipped beef is smoked to add flavor.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1031, 'Chivito', 8.99,'Uruguay','Filet mignon with mozzarella, tomatoes, mayonnaise, and commonly bacon, black or green olives, fried or hardboiled eggs, and ham');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1032, 'Choripán', 6.99,'South America, Caribbean','Grilled chorizo, usually served on a crusty roll with salsa-type condiments, such as pebre, salsa criolla, or chimichurri. Morcipán is a variety of this using black pudding or blood sausage.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1033, 'Chow mein', 8.99,'United States','A brown gravy base and chow mein mixture on a hamburger-style bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1034, 'Churrasco', 7.99,'Chile','Thinly cut steak, grilled and served on a toasted bun. It can be served with almost any other ingredient, in which case its name changes to "churrasco+the new ingredient" (e.g.: churrasco palta = churrasco and avocado)');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1035, 'Club', 8.99,'United States','A triple-decker sandwich made with sliced turkey or chicken, bacon, tomato, and lettuce; usually contains mayonnaise');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1036, 'Corned beef', 7.99,'','Corned beef often served with a condiment such as pickle or mustard.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1037, 'Crisp', 4.99,'United Kingdom','Crisps and occasionally pickles on white bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1038, 'Croque-monsieur', 4.99,'France','A grilled ham and cheese (typically Emmental or Gruyère) sandwich, sometimes coated in a mornay or béchamel sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1039, 'Croque-madame', 7.99,'France','Same as a croque-monsieur, but with a fried egg on top.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1040, 'Cuban', 5.99,'United States (Tampa, Florida) and Cuba','Ham, roasted pork, Swiss cheese, pickles, mustard, and sometimes Genoa salami on Cuban bread, usually pressed and warmed in a plancha');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1041, 'Cucumber', 5.99,'United Kingdom','Two thin slices of crustless, lightly buttered white bread, containing paper-thin slices of peeled cucumber');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1042, 'Cudighi', 5.99,'Italy','Spicy cudighi (a Michigan variety of Cotechino Italian sausage), on a long, hard roll, often topped with mozzarella and tomato sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1043, 'Dagwood', 5.99,'United States','Multiple layers containing a wide variety of meats and condiments, named for Dagwood Bumstead of the comic strip Blondie');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1044, 'Deli sandwich', 9.99,'','This sandwich may be ordered at a deli; choices include type of bread (toasted or untoasted,) type of meat (cold cut), type of sliced cheese, vegetable fillings (lettuce, tomato, onion, etc.), and condiments');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1045, 'Denver', 5.99,'United States','A sandwich containing a Denver omelette');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1046, 'Doner kebab', 5.99,'Turkey','Doner kebab is meat cooked on a vertical spit, normally veal or beef but also may be a mixture of these with lamb, and sometimes chicken. This may be served wrapped in a flatbread such as lavash or pita, or as a sandwich.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1047, 'Donkey burger', 7.99,'China','Chopped or shredded savory donkey meat in a bun, sold in Baoding, Hebei Province as street food, and also in high-end restaurants');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1048, 'Doubles', 5.99,'Trinidad and Tobago','Two flat fried bara (bread), containing curried chickpeas or garbanzo beans');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1049, 'Dynamite', 8.99,'United States (Woonsocket, Rhode Island)','Made of ground beef, tomato sauces, spices and many onions and peppers. It is a popular food served at local family gatherings and fundraising benefits, usually made in large quantities.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1050, 'Dyrlægens natmad', 7.99,'Denmark','On a piece of dark rye bread, a layer of leverpostej, topped with a slice of salt beef and a slice of meat aspic, topped with raw onion rings and garden cress.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1051, 'Elvis sandwich', 8.99,'United States','Peanut butter, banana, and bacon');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1052, 'Egg', 9.99,'Worldwide','Generic sandwich: This contains eggs, usually sliced hard boiled eggs or egg salad, but may be made with fried or (more rarely) scrambled egg, topped with the local roe spread, locally called kaviar.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1053, 'Fairy bread', 5.99,'Australia and New Zealand','White bread with nonpareils (= ''sprinkles'' (U.S.) or ''hundreds and thousands'' (U.K.)) on a spread of butter. Often cut into squares or triangles.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1054, 'Falafel', 5.99,'Middle East','Deep-fried balls of ground, seasoned chickpeas topped with salad vegetables, hot sauce, tahini-based sauces, and pickled vegetables, wrapped in or added to the pocket of a split-open pita bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1055, 'Fischbrötchen', 5.99,'Germany','Crusty bread rolls filled with fish (most commonly Bismarck or soused herring) and onions');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1056, 'Fool''s Gold Loaf', 4.99,'Colorado, United States','Consists of a single warmed, hollowed-out loaf of bread filled with one jar of creamy peanut butter, one jar of grape jelly, and a pound of bacon. In 1976, Elvis Presley and some of his friends flew to Colorado to consume them.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1057, 'Fluffernutter', 5.99,'United States','Peanut butter and marshmallow creme. Pictured is a fluffernutter sandwich prior to being assembled.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1058, 'Francesinha', 9.99,'Portugal','Wet-cured ham, linguiça, fresh sausage (chipolata), steak or other roast meat, topped with melted cheese, a hot thick tomato, and beer sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1059, 'Francesinha poveira', 6.99,'Portugal','A bun with wet-cured ham, linguiça, and cheese, sauced with butter or margarine, piri-piri, and port wine, whiskey, cognac, or brandy');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1060, 'French dip', 9.99,'United States','Thinly sliced roast beef on a baguette, served hot, usually au jus (with juice)');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1061, 'Fried brain', 8.99,'United States','Sliced calves'' brain on sliced bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1062, 'Fruit', 5.99,'Global','Fruit, often fruits such as banana, fig or pineapple served on bread, often with mayonnaise in the United States.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1063, 'Ftira', 4.99,'Malta','A traditional Maltese sandwich made on a large round piece of Maltese ftira bread, topped with tomato paste, tuna, capers, and red onions.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1064, 'Gatsby', 5.99,'South Africa','A deli-style sandwich similar to the hoagie, often containing french fries, with other variations, prepared with masala steak, chicken, polony, Vienna sausages, calamari, fish, or chargrilled steak');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1065, 'Gerber', 7.99,'St. Louis, Missouri, United States','Half section of Italian or French bread with garlic butter, containing ham, provel or provolone cheese, topped with paprika, then toasted');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1066, 'Guajolota', 7.99,'Mexico (Mexico City)','A tamale in a mexican bolillo roll. A very common morning street food in Mexico City. It is also called torta de tamal');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1067, 'Gyro', 8.99,'Greece','Pita gyro or "psomaki gyro," depending on the type of bread used, includes meat roasted on a vertical spit, with tomato, potatoes, raw, often red onion and tzatziki sauce, wrapped in pita or sandwich bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1068, 'Hagelslag or vlokken', 4.99,'The Netherlands','Chocolate sprinkles or flakes usually served on buttered bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1069, 'Ham', 9.99,'','May be accompanied by cheese or salad. Condiments such as mustard, mayonnaise, or pickle may be present.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1070, 'Ham and cheese', 8.99,'','A common sandwich prepared with ham and sliced cheese. Additional ingredients may include lettuce, tomato, mayonnaise, and other ingredients.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1071, 'Ham and egg bun', 4.99,'Hong Kong','Sliced Danish canned ham with sliced scrambled egg sheet in a halved sweet bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1072, 'Hamburger', 6.99,'United States','A ground beef patty, often with vegetables, sauces and other meats, usually on a round bun.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1073, 'Hamdog', 8.99,'','A hot dog wrapped in a beef patty, deep-fried, then covered with chili, a few french fries, and a fried egg');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1074, 'Horseshoe', 8.99,'Springfield, Illinois, United States','A thick-sliced, toasted, open-faced sandwich, it usually contains hamburger patties or ham, but other meat, such as deep-fried pork tenderloin, grilled or fried chicken breast, and fried fish filets, can be used. The meat is topped with french fries and covered with a cheese sauce.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1075, 'Hot brown', 4.99,'United States (Louisville, Kentucky)','Open-faced with turkey and bacon, topped with mornay sauce, and baked or broiled');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1076, 'Hot chicken', 7.99,'Quebec, Canada','Coarsely shredded or sliced chicken, sandwiched between two pieces of sliced bread, and completely covered with gravy.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1077, 'Hot turkey', 4.99,'United States','Often open-faced, sliced turkey on white bread drenched in turkey gravy, often served with mashed potatoes. These are sometimes served at Hofbrau-style restaurants.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1078, 'Ice cream', 7.99,'United States','Vanilla ice cream between thin biscuits, cookies or slices of cake, normally chocolate');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1079, 'Italian beef', 5.99,'United States (Chicago, Illinois)','Thin slices of seasoned, juicy roast beef, often garnished with giardiniera or Italian sweet peppers, on a dense, long Italian-style roll');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1080, 'Italiano', 7.99,'Chile','Not a sandwich, it refers to a set of toppings to put in a sandwich, refers to the colors of the Italian flag: red (tomato), white (mayonnaise) and green (avocado)');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1081, 'Jam', 7.99,'United Kingdom','Buttered bread, with jam (traditionally strawberry), normally eaten at lunchtime or as a quick snack, may also be eaten at breakfast or for high tea');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1082, 'Jambon-beurre', 9.99,'France','A French baguette with butter and ham. Also known as "Parisien," it is the most popular sandwich in France.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1083, 'Jibarito', 8.99,'United States','Meat, cheese, lettuce, and tomato, between flattened, fried green plantains (instead of bread), with garlic-flavored mayonnaise');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1084, 'Jucy Lucy', 8.99,'United States (Minneapolis, Minnesota)','A cheeseburger with the cheese inside the meat patty rather than on top');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1085, 'Katsu sando', 8.99,'Japan','Breaded, deep-fried pork cutlet (tonkatsu)');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1086, 'Kokoretsi', 5.99,'','Lamb or goat intestines, containing seasoned offal');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1087, 'Kottenbutter', 6.99,'Germany','Buttered brown bread with smoked pork sausage (Kottenwurst), fresh onion rings, and spicy mustard');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1088, 'Leberkäse', 6.99,'Bavaria','A meatloaf-like dish which, despite the name, contains neither liver nor cheese. It is commonly served on a Kaiser roll with mustard.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1089, 'Lettuce', 7.99,'','Lettuce and mayonnaise');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1090, 'Limburger sandwich', 8.99,'','They are typically prepared with buttered rye bread, Limburger cheese, sliced onion and mustard. Pictured is Limburger cheese and bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1091, 'Lobster roll', 9.99,'Northeastern United States','Lobster meat tossed with either mayonnaise ("cold") or drawn butter ("hot") stuffed into a slit opening at the top of a grilled bread roll or hot dog bun.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1092, 'Lox', 5.99,'United States','Lox on a bagel with cream cheese, thinly sliced onion, capers, and sometimes sliced tomato');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1093, 'Luther burger', 4.99,'United States','A hamburger or cheeseburger on glazed doughnuts instead of a bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1094, 'Marmite', 6.99,'United Kingdom','Marmite spread thinly with butter or margarine onto toast or bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1095, 'Martino', 7.99,'Belgium','Filet américain (steak tartare) with Worcestershire sauce, pickles, onions, peppers, and martino sauce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1096, 'Meatball', 9.99,'United States','Meatballs in marinara sauce, with melted Parmesan or provolone cheese, on a long bun or section of Italian loaf. Might include Italian-style accompaniments such as bell peppers, basil, or Italian-dressed lettuce');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1097, 'Medianoche', 6.99,'Cuba','Roast pork, ham, mustard, Swiss cheese, and dill pickles served on sweet bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1098, 'Mitraillette', 6.99,'Belgium','French fries and fried meat with sauce on a demi-baguette.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1099, 'Melt', 5.99,'United States','A generic sandwich containing a filling and a layer of cheese, grilled or fried until the cheese is melted');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1100, 'Mettbrötchen', 6.99,'Germany','Open sandwich consisting of a sliced bun, topped with Mett (seasoned minced pork without bacon), frequently with a garnish of raw onion rings or diced raw onion');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1101, 'Mollete', 9.99,'Spain and Mexico','A typical food of Mexico and a kind of bread in Spain. In Mexico, Molletes are prepared with melted cheese and beans with other ingredients, such as salsa, ham, or bacon.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1102, 'Montadito', 4.99,'Spain','Small, usually grilled, and may contain a variety of fillings. Some bars offer a variety of 200 different types of these sandwiches.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1103, 'Monte Cristo', 9.99,'United States','Sliced ham and cheese (usually Emmental or Gruyère) between slices of French toast and batter-fried. In some regions it is sprinkled with powdered sugar and served with jelly or jam). In other regions (New England), it is served savory with French mustard and no powdered sugar.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1104, 'Montreal-style smoked meat', 9.99,'Canada','A sandwich made from cured and smoked brisket with yellow mustard, usually on rye bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1105, 'Mortadella', 9.99,'','Any sandwich containing mortadella, a large Italian sausage');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1106, 'Mother-in-law', 9.99,'United States','A hot dog bun containing a Chicago-style corn-roll tamale, topped with chili');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1107, 'Muffuletta', 9.99,'United States','Originated in New Orleans'' Italian-American community, this contains meats, cheeses, and olive salad on a round bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1108, 'Naan sandwich', 5.99,'Pakistan','Beef on naan bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1109, 'Open-faced sandwich', 7.99,'Nordic','Consists of a single slice of bread with one or more food items on top. See also pizza.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1110, 'Pambazo', 8.99,'Mexico','Made with pambazo bread dipped in a red guajillo pepper sauce and filled with potatoes and chorizo.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1111, 'Pan-bagnat', 4.99,'France','Round bread (bread bagnats) topped with green salad, tomatoes, hard-boiled eggs, tuna, anchovies, cucumbers, fava beans, artichokes, green peppers, radishes, onions, basil, and black olives. Condiments may include garlic, vinegar, olive oil, salt, and pepper. Served chilled.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1112, 'Panini', 9.99,'Italy','In Italy, panino is the word for a sandwich made from bread other than sliced bread, in which case Italians call it a tramezzino. Examples of bread types used are ciabatta, rosetta and baguette. The bread is cut horizontally and filled with deli ingredients such as salami, ham, cheese, mortadella, or other food, and is sometimes pressed by a warming grill. In the United States, United Kingdom, and Canada, the term panini is used to refer to a long pressed and toasted sandwich; there is widespread availability and use of sandwich presses, often known as "panini presses".');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1113, 'Patty melt', 9.99,'United States','Consists of a hamburger patty, pieces of sautéed or grilled onion, and Cheddar or Swiss cheese between two slices of bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1114, 'Peanut butter and jelly', 9.99,'United States','Jam is often used in place of jelly. Also known as a PB&J.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1115, 'Pebete', 6.99,'Argentina','A simple Argentine sandwich, traditionally filled with cheese, cured meat, tomato, and mayonnaise. Pebete actually refers to the bread used for the sandwich - a soft oval bun with a spongy inside, and a thin toasted crust.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1116, 'Pimento cheese', 4.99,'Southern United States','A common food preparation in the Southern United States, a spread or relish made with cheese, mayonnaise, pimentos, salt and pepper, blended to either a smooth or chunky paste. Regional variations incorporate additional ingredients. Also eaten in the United Kingdom (see "Tea" in this list) and the Philippines.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1117, 'Pistolette', 6.99,'','A stuffed and fried bread roll (sometimes called stuffed pistolettes) in the Cajun areas around Lafayette. This also refers to a type of submarine-shaped bread about half the size of a baguette that is popular in New Orleans for Vietnamese bánh mì and other sandwiches.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1118, 'Pljeskavica', 6.99,'Balkans','A patty dish popular in the Balkan region of Southeastern Europe, a sandwich utilizes the Pljeskavica patty and bread.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1119, 'Ploughman''s lunch', 6.99,'United Kingdom','A cold meal originating in the United Kingdom, commonly served in pubs. Its core components are (cheddar) cheese, ploughman''s pickle, and bread. It is traditionally eaten with beer.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1120, 'Po'' boy', 8.99,'United States','A crusty bread loaf typically filled with fried seafood or roast beef.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1121, 'Polish boy', 5.99,'United States (Cleveland, Ohio)','Kielbasa sausage in a bun, covered with french fries, barbecue sauce (or hot sauce), and coleslaw');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1122, 'Porilainen', 6.99,'Finland','A half-inch slice of thick sausage, usually with diced red or sweet onion, sliced pickles, ketchup, mustard, and sometimes mayonnaise, on white bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1123, 'Pork chop bun', 5.99,'Macau','A popular dish in Macau, the bun is extremely crisp outside and very soft inside, containing a freshly fried pork chop.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1124, 'Pork tenderloin', 6.99,'United States','A thin, tenderized, deep-fried pork loin, served on a bun.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1125, 'Prawn roll', 4.99,'Australia','');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1126, 'Primanti', 8.99,'Pittsburgh, Pennsylvania, United States','Selection of grilled meats topped with french fries, coleslaw, and tomato on Italian bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1127, 'Prosperity Sandwich', 4.99,'United States (St. Louis)','Ham and turkey topped with broiled cheese. Sometimes includes bacon and tomato.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1128, 'Pudgy Pie', 9.99,'United States','This sandwich can be made in a pan. Margarine on the outside, pizza sauce and fillings on the inside. The term "pudgy pie" is sometimes used to refer to pie irons, a gadget used for campfire cooking.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1129, 'Pulled pork sandwich', 5.99,'Southern United States','Form of barbecue in which pork is cooked using a slow cook method until the meat becomes tender enough that it can be "pulled", or easily broken into individual pieces. The pork is often topped with barbecue sauce and vinegar- or mayonnaise-based coleslaw depending on the region');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1130, 'Reuben', 9.99,'United States','Corned beef, sauerkraut, Swiss cheese, topped with Russian or Thousand Island dressing, on rye bread, then grilled');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1131, 'Roti john', 7.99,'Malaysia','Basic ingredients are eggs, chopped onions, sambal paste, salt, and pepper, cooked as an omelette with the bread added on top before it''s fully cooked. Many variations include canned sardines, chicken, beef, or mutton. Garnished with mayo, chili sauce, and cheese.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1132, 'Rou jia mo', 5.99,'China','Stewed pork, chopped finely, and stuffed in mo, a kind of flatbread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1133, 'Runza', 6.99,'United States','A bun filled with a mixture of (usually) loose meat, cabbage, and cheese. The fillings are baked inside the bread, similar to a kolache. Popular in the Midwestern United States, especially Nebraska.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1134, 'Sailor sandwich', 4.99,'United States (Richmond, Virginia)','Hot pastrami, grilled knockwurst, melted Swiss and hot mustard on rye bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1135, 'Sandwich loaf', 6.99,'United States','Alternating layers of bread and filling frosted to resemble a layer cake');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1136, 'De miga', 9.99,'Argentina','Made with single-, double-, or triple-layered, buttered, thin white bread with crust removed, toasted or untoasted, containing thinly sliced meat, as well as eggs, cheese, tomatoes, green peppers, lettuce, olives, and sometimes other vegetables.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1137, 'Salt beef bagel', 6.99,'United Kingdom','Especially noted from Beigel Bake in Brick Lane, east London.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1138, 'Sausage', 8.99,'United Kingdom and Germany','A sausage on a roll or bread, served with a variety of sauces and toppings.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1139, 'Shawarma', 7.99,'The Levant','Flatbread with fillings of beef, spinach, tomatoes, cucumber, and tahini sauce, wrapped and grilled.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1140, 'Shuco', 8.99,'Guatemala','A dry hot dog bun containing guacamole, sliced cabbage, ketchup, mustard and mayonnaise. It''s usually served with a sausage, but it can also be ordered with churrasco or adobado beef. Chopped onions and a variety of hot sauces are also available for the sandwich.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1141, 'Slider', 4.99,'United States','Basically a miniature hamburger about three inches in diameter, but may also contain other ingredients');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1142, 'Sloppy joe', 8.99,'United States','Ground meat, usually beef, cooked with seasoned tomato sauce and served on a round bun.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1143, 'Sloppy joe (New Jersey)', 6.99,'United States','A triple decker rye bread sandwich made with one or more types of sliced deli meat, such as turkey, ham, pastrami, corned beef, roast beef, or sliced beef tongue, along with Swiss cheese, coleslaw, and Russian dressing');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1144, 'Smörgåstårta', 7.99,'Sweden','Multiple layers of white or light rye bread containing creamy fillings, such as egg and mayonnaise, liver paté, olives, shrimp, ham, various cold cuts, caviar, tomato, cucumber, cheese, and smoked salmon');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1145, 'Smørrebrød', 4.99,'Denmark','Open-faced, buttered dark rye bread with cold cuts, pieces of meat or fish, cheese, or spreads');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1146, 'Sol over Gudhjem', 5.99,'Denmark','An open-faced sandwich on rugbrød, with smoked herring, chives, and a raw egg yolk');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1147, 'Souvlaki', 8.99,'Greece','A sizzling skewer of lamb, beef, pork, or chicken roasted, shaved off the spit, and marinade ranging from hot barbecue to sweet, all laid out on a rolled pita bread, sprinkled with your choice of lettuce, tomato, cheese, red onion, and oregano, and doused with tzatziki sauce.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1148, 'Spiedie', 6.99,'United States','Marinated cubes of chicken, pork, lamb, veal, venison, or beef, grilled on a spit, and served in a bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1149, 'St. Paul', 4.99,'St. Louis, Missouri, United States','An egg foo young patty (containing bean sprouts and minced white onions), dill pickle slices, white onion, mayonnaise, lettuce, and tomato on white bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1150, 'Steak bomb', 7.99,'United States','A grilled, over-stuffed submarine roll, containing shaved steak, and topped with salami, melted provolone, sautéed onions, and bell peppers.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1151, 'Steak burger', 5.99,'','Typically prepared with ground, sliced or minced beefsteak meat. Additional meats are also used.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1152, 'Steak', 8.99,'United States','Prepared with cooked steak, served on bread or a roll. Steak sandwiches may include toppings such as cheese, onions, mushrooms, bell peppers, hot peppers, tomatoes, and in some instances fried eggs, cole slaw, or french fries.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1153, 'Submarine/Sub/Baguette', 7.99,'United States','A generic sandwich served on a long French or Italian roll which may contain a wide variety of sliced meats, vegetables, and condiments, including lettuce, tomato, sweet peppers, onions, olives, and mushrooms. Also known regionally as a hero, a hoagie, a grinder, or a zep, among other names. In the United Kingdom it is named a baguette, after the French bread used to make it.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1154, 'Tavern', 4.99,'United States','Common in Iowa, consists of a mixture of unseasoned ground beef and sauteed onions, sometimes topped with pickles, ketchup, and mustard, on a bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1155, 'Tea', 8.99,'United Kingdom','Thinly sliced white bread with crusts removed, lightly buttered, containing a light spread of cream cheese or mayonnaise mixture, and often radishes, cucumber, asparagus, or watercress. Other fillings may be pimento cheese, ham with mustard, smoked salmon, fruit jam, curried chicken, and egg salad.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1156, 'TLT (Tempeh, Lettuce, and Tomato)', 9.99,'United States','Vegan version of the BLT: smoky baked tempeh, lettuce, tomato, and avocado, served on toasted sourdough bread');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1157, 'Toast', 8.99,'UK','A thin slice of toast between two thin slices of bread with a layer of butter, and salt and pepper to taste.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1158, 'Toast Hawaii', 6.99,'Germany','A slice of toast with ham, a maraschino cherry in the middle of a pineapple slice, and cheese, grilled from above, so the cheese starts to melt.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1159, 'Toastie', 8.99,'','Two slices of bread with various fillings, toasted in a sandwich toaster.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1160, 'Tofu Sandwich', 4.99,'United States','Tofu, typically broiled or baked, with vegetables.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1161, 'Tongue toast', 5.99,'','Sautéed beef tongue and scrambled eggs, served open-faced');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1162, 'Torta', 7.99,'México','A mexican roll (either telera or bolillo) spread with mayo and/or refried beans and stuffed with various sliced meats, cheeses, vegetables (usually tomatoes, onions and avocado) and your choice of pickled jalapeños or chipotle peppers. It can either be made ahead and tightly wrapped for a packed lunch or (if made to order) grilled on both sides with some butter.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1163, 'Torta ahogada', 9.99,'México (Guadalajara)','Birote bread (similar to bolillo) filled with "carnitas" (deep-fried pork), shredded chicken or other meats, beans and cheese. The torta is then dipped in a very hot tomato and dried chile de árbol sauce and topped with pickled sliced onions.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1164, 'Tramezzino', 9.99,'Italy','Triangular white bread with the crusts removed, with fillings such as tuna and olive and prosciutto, served in Italian bars throughout the day');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1165, 'Tripleta', 5.99,'Puerto Rico','Although there are numerous variations, the main distinction is a combination of three meats, typically grilled, such as beef (usually churrasco steak or cube steak), roast pork (pernil), chicken, and ham. Condiments may include some combination of mustard, ketchup, and mayonnaise, often combined to create a special sauce. Popular toppings include thin crispy fried potato sticks or shoestring potatoes, thinly sliced cabbage, lettuce, onion, tomato, pickles, and Swiss cheese. The sandwich is often toasted in a sandwich press.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1166, 'Tuna', 4.99,'United States','Usually made with tuna salad, which may include mayonnaise, sweetcorn, cucumber, or celery. Other common variations include the tuna boat and tuna melt.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1167, 'Vada pav', 8.99,'India','A potato fritter coated in chickpea flour (batata vada) in a bun');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1168, 'Vegemite', 7.99,'Australia','Vegemite is a dark brown Australian food paste made from used brewers'' yeast extract, a by-product of beer manufacturing, various vegetables, wheat, and spice additives. It is a spread for sandwiches, toast, crumpets, and cracker biscuits, as well as a filling for pastries.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1169, 'Vegetable', 4.99,'','Many types of vegetables are used to prepare vegetable sandwiches.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1170, 'Welsh rarebit', 9.99,'United Kingdom','A hot melted cheese sauce, poured over slices (or other pieces) of toasted bread. The hot cheese sauce may also be served in a bowl accompanied by the toast.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1171, 'Wrap', 8.99,'','Flat bread (often a tortilla) tightly wrapped around the sandwich filling with the ends tucked in to form a neat bundle. Fillings can vary widely.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1172, 'Wurstbrot (sausage bread)', 5.99,'Germany','A simple and common German sandwich prepared with thin slices of lunch meat or sausage, sometimes buttered.');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1173, 'Yakisoba-pan', 7.99,'Japan','A hot dog bun stuffed with fried noodles, frequently topped with pickles, such as beni shoga, with mayonnaise');
INSERT INTO sandwiches (id, name, price, origin, description) VALUES(1174, 'Zapiekanka', 6.99,'Poland','A halved baguette or other bread usually topped with mushrooms and cheese, ham or other meats, and vegetables');
